import React from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Chip,
  IconButton,
  Typography,
  Box,
  Avatar,
  Tooltip
} from '@mui/material';
import {
  Visibility as VisibilityIcon,
  Assignment as AssignmentIcon,
  Person as PersonIcon
} from '@mui/icons-material';

const getStatusColor = (status) => {
  switch (status) {
    case 'new':
      return 'info';
    case 'in_progress':
      return 'warning';
    case 'on_hold':
      return 'error';
    case 'resolved':
      return 'success';
    default:
      return 'default';
  }
};

const getPriorityColor = (priority) => {
  switch (priority) {
    case 'urgent':
      return 'error';
    case 'high':
      return 'warning';
    case 'medium':
      return 'info';
    case 'low':
      return 'success';
    default:
      return 'default';
  }
};

const TicketList = ({ tickets, onAssign, showAssignButton = false }) => {
  const navigate = useNavigate();

  const handleViewTicket = (ticketId) => {
    navigate(`/tickets/${ticketId}`);
  };

  if (!tickets?.length) {
    return (
      <Box sx={{ p: 3, textAlign: 'center' }}>
        <Typography variant="h6" color="textSecondary">
          No tickets found
        </Typography>
      </Box>
    );
  }

  return (
    <TableContainer component={Paper}>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Ticket #</TableCell>
            <TableCell>Client</TableCell>
            <TableCell>Product</TableCell>
            <TableCell>Category</TableCell>
            <TableCell>Priority</TableCell>
            <TableCell>Status</TableCell>
            <TableCell>Created</TableCell>
            <TableCell>Assigned To</TableCell>
            <TableCell>Actions</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {tickets.map((ticket) => (
            <TableRow key={ticket._id}>
              <TableCell>{ticket.ticketNumber}</TableCell>
              <TableCell>
                <Typography variant="body2">{ticket.client.company}</Typography>
                <Typography variant="caption" color="textSecondary">
                  {ticket.client.name}
                </Typography>
              </TableCell>
              <TableCell>
                <Typography variant="body2">{ticket.product.name}</Typography>
                <Typography variant="caption" color="textSecondary">
                  {ticket.product.type || ticket.product.serialNumber}
                </Typography>
              </TableCell>
              <TableCell>
                <Chip
                  size="small"
                  label={ticket.category}
                  color={ticket.category === 'hardware' ? 'primary' : 'secondary'}
                />
              </TableCell>
              <TableCell>
                <Chip
                  size="small"
                  label={ticket.priority}
                  color={getPriorityColor(ticket.priority)}
                />
              </TableCell>
              <TableCell>
                <Chip
                  size="small"
                  label={ticket.status.replace('_', ' ')}
                  color={getStatusColor(ticket.status)}
                />
              </TableCell>
              <TableCell>
                {new Date(ticket.createdAt).toLocaleDateString()}
              </TableCell>
              <TableCell>
                {ticket.assignedTo ? (
                  <Tooltip title={`Assigned to: ${ticket.assignedTo.name}`}>
                    <Box sx={{ display: 'flex', alignItems: 'center' }}>
                      <Avatar 
                        sx={{ width: 24, height: 24, mr: 1, bgcolor: 'primary.main' }}
                      >
                        {ticket.assignedTo.name.charAt(0)}
                      </Avatar>
                      <Typography variant="body2" noWrap>
                        {ticket.assignedTo.name}
                      </Typography>
                    </Box>
                  </Tooltip>
                ) : (
                  <Chip
                    size="small"
                    label="Unassigned"
                    icon={<PersonIcon />}
                    variant="outlined"
                    color="default"
                  />
                )}
              </TableCell>
              <TableCell>
                <IconButton
                  size="small"
                  onClick={() => handleViewTicket(ticket._id)}
                  title="View Details"
                >
                  <VisibilityIcon />
                </IconButton>
                {showAssignButton && !ticket.assignedTo && (
                  <IconButton
                    size="small"
                    onClick={() => onAssign(ticket._id)}
                    title="Assign Ticket"
                  >
                    <AssignmentIcon />
                  </IconButton>
                )}
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default TicketList;
